import * as React from 'react';
import { useState, useEffect } from 'react';
import {Box, TextField, InputLabel, Select, MenuItem, FormControl} from '@mui/material';

export default function FormPropsTextFields() {
  const [typeOfDonation, setTypeOfDonation] = useState("");

  const handleTypeOfDonationChange = (type) => setTypeOfDonation(type) 

  return (
    <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      validate
      autoComplete="off"
      >
      <div>
        <TextField
          // required
          id="outlined-required"
          label="First name"
          placeholder="first name"
        />
        <TextField
          // required
          id="outlined-required"
          label="Last name"
          placeholder="last name"
          />
      </div>

      <div>
      <FormControl sx={{ m: 1, minWidth: "25ch" }}>
          <InputLabel id="demo-simple-select-label">Type of donation</InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={typeOfDonation}
            label="Type of donation"
            onChange={handleTypeOfDonationChange}
          >
            <MenuItem value={typeOfDonation}>money</MenuItem>
            <MenuItem value={typeOfDonation}>food</MenuItem>
            <MenuItem value={typeOfDonation}>clothing</MenuItem>
            <MenuItem value={"etc."}>etc.</MenuItem>
          </Select>
        </FormControl>
      </div>

      <div>

      </div>
    </Box>
    // <Box>
    // </Box>

  );
}
